package ru.leetcode.medium.task438;

import org.junit.jupiter.api.Test;

import java.util.Collections;
import java.util.List;

import static org.junit.jupiter.api.Assertions.assertEquals;

/**
 * Given two strings s and p, return an array of all the start indices of p's anagrams in s. You may return the answer in any order.
 *
 * Example 1:
 * Input: s = "cbaebabacd", p = "abc"
 * Output: [0,6]
 * Explanation:
 * The substring with start index = 0 is "cba", which is an anagram of "abc".
 * The substring with start index = 6 is "bac", which is an anagram of "abc".
 *
 * Example 2:
 * Input: s = "abab", p = "ab"
 * Output: [0,1,2]
 * Explanation:
 * The substring with start index = 0 is "ab", which is an anagram of "ab".
 * The substring with start index = 1 is "ba", which is an anagram of "ab".
 * The substring with start index = 2 is "ab", which is an anagram of "ab".
 *
 * Constraints:
 * 1 <= s.length, p.length <= 3 * 104
 * s and p consist of lowercase English letters.
 */

class SolutionTest {
    @Test
    public void leetcodeCase1() {
        Solution solution = new Solution();
        String s = "cbaebabacd";
        String p = "abc";
        List<Integer> expected = List.of(0, 6);
        List<Integer> actual = solution.findAnagrams(s, p);
        assertEquals(expected, actual);
    }

    @Test
    public void leetcodeCase2() {
        Solution solution = new Solution();
        String s = "abab";
        String p = "ab";
        List<Integer> expected = List.of(0, 1, 2);
        List<Integer> actual = solution.findAnagrams(s, p);
        assertEquals(expected, actual);
    }

    @Test
    public void leetcodeCase3() {
        Solution solution = new Solution();
        String s = "";
        String p = "";
        List<Integer> expected = List.of(0, 10001);
        List<Integer> actual = solution.findAnagrams(s, p);
        assertEquals(expected, actual);
    }

    @Test
    public void leetcodeCase4() {
        Solution solution = new Solution();
        String s = "aaabb";
        String p = "bb";
        List<Integer> expected = List.of(3);
        List<Integer> actual = solution.findAnagrams(s, p);
        assertEquals(expected, actual);
    }

    @Test
    public void cornerCase1() {
        Solution solution = new Solution();
        String s = "abab";
        String p = "ab";
        List<Integer> expected = Collections.emptyList();
        List<Integer> actual = solution.findAnagrams(p, s);
        assertEquals(expected, actual);
    }
}